import React from 'react';
import './ArtisanDashboard.css'; // Import artisan dashboard CSS

const ArtisanDashboard = () => {
  return (
    <div className="dashboard-container">
      <h1>Artisan Dashboard</h1>
      <h2>Manage Services</h2>
      <button>Add New Service</button>
      <ul className="service-list">
        <li>Service 1 <button>Edit</button> <button>Delete</button></li>
        <li>Service 2 <button>Edit</button> <button>Delete</button></li>
        {/* More services */}
      </ul>
      <h2>Feedback</h2>
      {/* List of reviews */}
    </div>
  );
};

export default ArtisanDashboard;
